function App() {
  return (
    <div className="App">
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
                <div className="container">
                    <span style={{ color: 'white', fontSize: '1.6rem' }}>Welcome To Amadis</span>
                    <div id="navbarResponsive">
                        <ul className="navbar-nav">
                            {menuItems.map((menu, i) =>
                                <li className='nav-item mx-0 mx-lg-1' key={i}>
                                    <Link to={'/' + menu.key} className='li'>{menu.displayName}</Link>
                                </li>
                            )
                            }
                        </ul>
                    </div>
                </div>
            </nav>

          <div className='row'>
            <div className='col-6' image>
              <img src={img1} width='700px' height='600px'></img>
            </div>
            <div className='col-6 login'>
              <h2 className='heading'>Login Here</h2>

              <Login/>            

            </div>
          </div>

      </div>

  );
}

export default App;
